{"reasoning":"The ground-truth bug is that a helicopter is inexplicably flying even though its rotor blades are completely motionless. The key symptom is the visually incorrect, non-spinning rotors while the helicopter is airborne.

The generated report talks about an extraction event where an NPC spawns under a helicopter, no rope appears, the NPC ragdoll hovers, then falls. The main problem is the missing rope and NPC animation issues, not the rotor blades. There is no mention of rotor motion, helicopter flight dynamics, or anything related to rotor animation.

Because the core issues described are different (rotor blades not spinning vs. extraction rope/NPC ragdoll malfunction), the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth bug: an animal (likely a deer) is launched into the air as a direct result of being hit by an arrow – the arrow impact imparts excessive force and projects the animal upward.

Generated bug: a mammoth NPC initially spawns high in the air, then falls through world geometry, clipping through objects, and is temporarily invulnerable. The problem is tied to spawn position and collision, not to being shot.

Different trigger (spawn vs. arrow hit), different symptoms (floating spawn and clipping through world vs. being propelled upward by impact), and different creatures. Thus they describe different underlying issues.","match":false}

{"reasoning":"The ground-truth bug concerns the character becoming suspended in mid-air and endlessly looping a hand-flapping animation. No mention is made of death, post-processing effects, UI elements, or collision with walls.

The generated report instead describes a scenario where the character clips into a pillar, excessive blur/vignette persists, HUD elements stay on screen, and the death/desynchronization banner misbehaves. It focuses on visual effects and UI state after death, not on the character floating in place with a looping animation.

Because the symptoms, triggers, and affected systems are different, the two reports do not reference the same underlying issue.","match":false}

{"reasoning":"The ground-truth bug concerns the vehicle’s position: after turning toward the building, the truck becomes airborne/hovering and clips through the building geometry. The problem is about incorrect animation/physics alignment of the truck with the ground and building.

The generated report, however, talks about roof or canopy panels duplicating, popping in and out, and ghosting during a cinematic overhead shot. It focuses on visual artifacts of roof meshes (likely LOD or streaming issues), not on the truck’s movement, hovering, or collision with walls.

Because the symptoms, affected assets, and nature of the bug are entirely different, the two reports do not describe the same underlying issue.","match":false}

{"reasoning":"Ground truth focuses on a post-death physics bug where the NPC is catapulted: after initially falling, the body is suddenly launched upward and sideways. The distinguishing symptom is the pronounced vertical/sideways propulsion.

Generated report instead speaks about a seated NPC that, when shot, instantly pops to a standing pose, then ragdolls and clips through nearby objects. There is no mention of being propelled into the air or a secondary launch; the key problem is the animation transition (seated → standing) and environmental clipping.

Since the signature behavior of the ground-truth bug (violent upward/sideways launch after falling) is absent from the generated report, and the generated report introduces a different unique symptom (snap from seated to standing), the two describe different underlying issues.","match":false}

{"reasoning":"Ground-truth issue: an NPC gets stuck in a repetitive up-and-down (bouncing) motion in the background – i.e., an animation/physics loop that never returns to normal idle behavior.

Generated report: describes a peasant NPC that, after a cut-scene, latches onto the rope-bridge support and continuously plays its climbing animation, ignoring normal state transitions. This is likewise an NPC stuck in an unintended repetitive vertical movement in the background scene, caused by an animation/physics problem.

Although the generated report specifies the exact location (rope bridge) and calls the motion a climbing loop rather than “bouncing,” both reports talk about the same underlying bug: an NPC’s animation gets stuck, causing continuous vertical movement and failure to return to idle. No conflicting details suggest a different problem. Therefore, they correspond to the same bug.","match":true}

{"reasoning":"Ground truth bug: the giant sea creature itself visibly slides briefly and then vanishes. Core symptoms: brief horizontal movement (slide) followed by disappearance of the creature.

Generated report: focuses on two different issues—(1) scanner dart hologram detaches and drifts, causing a camera snap, and (2) leviathan’s tentacles clip through geometry. The creature does not slide and vanish; instead it remains present while its hologram misbehaves and parts clip.

Because the described behaviors (hologram drift/camera snap/clipping) differ fundamentally from a creature sliding then disappearing, the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth bug: after some action the character becomes frozen in mid-air for a few seconds, unable to move, before gravity resumes and the character drops. Key symptom is a temporary suspension in the air (player stuck).

Generated report: concerns the Leap-Attack targeting system. The attack UI marker remains above a bird that has flown away; the player can still execute the dive attack, which misses and makes the character fall. There is no mention of the character hanging motionless in the air; the issue is about an incorrect target indicator and an attack being allowed on an invalid target.

Because the core symptom (being stuck in mid-air) is absent and the described cause/effect is different, the two reports refer to different bugs.","match":false}
